function getDaysInMonth(e,t){return new Date(e,t+1,0).getDate()}function getDayOfWeek(e,t){return new Date(e,t,1).getDay()}function createArray(e,t){var r=e+(t-1),n=(Math.ceil(r/7),[]);for(a=0;a<t-1;a++)n.push("");for(b=0;b<e;b++)n.push(b+1);if(n.length/7%1!=0)for(;n.length/7%1!=0;)n.push("");for(var o=[];n.length>0;)o.push(n.splice(0,7));return o}function writeHeaders(e){var t=["January","Feburary","March","April","May","June","July","August","September","October","November","December"];null!=e?document.getElementById(e).innerHTML='<div class="buttons"><a href="#" onClick="changeMonth(-1)"><</a>'+t[CurrentMonth]+" "+CurrentYear+'<a href="#" onClick="changeMonth(1)">></a></div><table class="table"><thead><tr><th scope="col">M</th><th scope="col">T</th><th scope="col">W</th><th scope="col">T</th><th scope="col">F</th><th scope="col">S</th><th scope="col">S</th></thead><tbody id="tCalendarBody"></tbody></table>':console.log("id is not set")}function writeRows(e,t){var r="<tr>";for(r+="<tr>",i=0;i<t.length;i++){for(j=0;j<t[0].length;j++)r+="<td>"+t[i][j]+"</td>";r+="</tr>"}document.getElementById(e).innerHTML=r}function createTable(e,t){writeHeaders(t),writeRows("tCalendarBody",e)}function calendar(e,t,r){if(null!=e)if(null!=t||null!=r)CurrentYear=t,CurrentMonth=r,createTable(createArray(getDaysInMonth(t,r),getDayOfWeek(t,r)),e);else{var n=new Date;CurrentMonth=n.getMonth(),CurrentYear=n.getFullYear(),createTable(createArray(getDaysInMonth(n.getFullYear(),n.getMonth()),getDayOfWeek(n.getFullYear(),n.getMonth(),0)),e)}else console.log("ID for the calendar to load to must be parsed")}function changeMonth(e){12==(CurrentMonth+=e)&&(CurrentMonth=0,CurrentYear+=1),-1==CurrentMonth&&(CurrentMonth=11,CurrentYear+=-1),calendar("test",CurrentYear,CurrentMonth)}var CurrentYear=0,CurrentMonth=0;
